window.bookSummaryJSON = "<p>I’m the prince of death.<br> <br> A son of carnage born of wicked deeds and sin-filled nightmares.<br> <br> Nobody understood me. Until her.<br> <br> My Spider.<br> <br> The wild girl I claimed from a sea of violent men. But others want her too….<br> <br> The enemies who lurk within my walls seek to steal her from my grasp. They’re my captives, but maybe they’re the answer to my greatest fear too. Because the Grim Reaper shadows every move I make, and he’s always watching her.<br> <br> Perhaps I need a ring of warriors to surround my little psycho and protect her from death’s claws.<br> <br> Because now she’s stolen my black heart, I can’t fail her like I’ve failed before.</p> <p>This is a dark romance series where the main character will end up with more than one love interest. This series is set in the United States of Anarchy universe. All the series in this world can be listened to independently, but if you’d like to enjoy the crossover characters, then you may also want to check out<i> Kings of Quarantine</i> and <i>The Harlequin Crew.</i></p>"; 
